class Solution:
    # @param s, an input string
    # @param p, a pattern string
    # @return a boolean
    def isMatch(self, s, p):
        '''
        Implement wildcard pattern matching with support for '?' and '*'.

'?' Matches any single character.
'*' Matches any sequence of characters (including the empty sequence).

The matching should cover the entire input string (not partial).

The function prototype should be:
bool isMatch(const char *s, const char *p)

Some examples:
isMatch("aa","a") → false
isMatch("aa","aa") → true
isMatch("aaa","aa") → false
isMatch("aa", "*") → true
isMatch("aa", "a*") → true
isMatch("ab", "?*") → true
isMatch("aab", "c*a*b") → false
        '''
        ps = p.split('*')
        if len(ps) == 1:
            return len(s) == len(p) and self.match(s, p)
        start = ps.pop(0)
        end = ps.pop()
        if not self.match(s, start):
            return False
        s = s[len(start):]
        if len(s) < len(end) or not self.match(s[len(s) - len(end):], end):
            return False
        s = s[:len(s) - len(end)]
        while len(ps) > 0:
            ts = ps.pop(0)
            if len(ts) == '':
                continue
            s, f = self.kmp(s, ts)
            if not f:
               return False
            s = s[len(ts):]
        return True

    def match(self, s, t):
        if len(s) < len(t):
            return False
        for i in range(len(t)):
            if not self.eq(s[i], t[i]):
                return False
        return True

    def isSubstring(self, s, t):
        if len(t) == 0:
            return s
        for i in range(len(s) - len(t) + 1):
            if s[i:].startswith(t):
                return s[i:]
        return None

    def eq(self, a, b):
        if a == '?' or b == '?':
            return True
        return a == b

    def kmp(self, s, t):
        if len(t) == 0:
            return [s, True]
        p = [-1] * len(t)
        j = -1
        for i in range(1, len(t)):
            while j >= 0 and not self.eq(t[j + 1], t[i]):
                j = p[j]
            if self.eq(t[j + 1], t[i]):
                j += 1
            p[i] = j

        j = -1
        for i in range(len(s)):
            while j >= 0 and not self.eq(s[i], t[j + 1]):
                j = p[j]
            if self.eq(s[i], t[j + 1]):
                j += 1
            if j == len(t) - 1:
                return [s[i - j:], True]
        return [None, False]

    #TLE
    def dp_solution(self, s, p):
        dp = [[False] * (len(p) + 1) for row in range(2)]
        dp[0][0] = True
        f = [[False] * (len(p) + 1) for row in range(2)]
        i = 0
        while i < len(p) and p[i] == '*':
            i += 1
            dp[0][i] = True
            f[0][i] = True
        x = 0
        y = 1
        for i in range(1, len(s) + 1):
            x = 1 - x
            y = 1 - y
            for j in range(len(p) + 1):
                f[x][j] = False
                dp[x][j] = False
            f[x][0] = True
            for j in range(1, len(p) + 1):
                if p[j - 1] == '*':
                    dp[x][j] = f[x][j - 1]
                elif dp[y][j - 1]:
                    dp[x][j] = p[j - 1] == '?' or p[j - 1] == s[i - 1]
                f[x][j] = f[y][j] or dp[x][j]
        return dp[x][len(p)]

